import React, { Component } from 'react'
import './Home.css'

class Home extends Component {
    constructor(props) {
        super(props)

        this.state = {
            openNav: false
        }

        this.revealNav = this.revealNav.bind(this)
        this.hideNav = this.hideNav.bind(this)
    }

    revealNav() {
        this.setState({
            openNav: true
        })
    }

    hideNav() {
        this.setState({
            openNav: false
        })
    }

    render() {
        return (
            <div>
                <h1>Welcome to the Home page</h1>
                <div className="toggle" openNav={this.revealNav} closeNav={this.hideNav}>
                    <span></span>
                    <span></span>
                    <span></span>
                </div>
            </div>
        )
    }
}

export default Home
